Lexer_result lexer(char* data, char* filename) {
	Lexer_result result = {
		.ok = 0,
		.malloc_info = {
			.start = NULL,
			.end = NULL,
		},
	};

	malloc_info = &result.malloc_info;

	result.tokens_count = 0;
	result.tokens = wmalloc(0);

	char* string = wzmalloc(1);
	int state = 1;

	int line = 1;
	int column = 1;

	for (int i = 0; i < strlen(data) + 1;) {
		char c = data[i];

		int nstate = rules[state - 1][c];

		if (nstate == -1)
			nstate = rules[state - 1][256];

		if (nstate == -1) {
			ERROR("%s %d:%d: unexpected character\n", filename, line, column);
			exit(1);
		}

		if (nstate == 0) {
			if (rules[state - 1][257] == STRING || rules[state - 1][257] == PATH) {
				char* new_string = wmalloc(strlen(string) - 1);
				memcpy(new_string, string + 1, strlen(string) - 2);
				wfree(string);
				string = new_string;
			}

			if (rules[state - 1][257] != SPACE) {
				result.tokens = wrealloc(result.tokens, sizeof(Token) * (++result.tokens_count));
				result.tokens[result.tokens_count-1].type = rules[state - 1][257];
				result.tokens[result.tokens_count-1].value = string;
				result.tokens[result.tokens_count-1].filename = filename;
				result.tokens[result.tokens_count-1].line = line;
				result.tokens[result.tokens_count-1].column = column - 1;
			}

			string = wzmalloc(1);
			state = 1;

			if (c == 0)
				break;

			continue;
		}

		int len = strlen(string);
		string = wrealloc(string, len + 2);
		string[len] = c;
		string[len + 1] = 0;

		if (c == '\n') {
			line++;
			column = 1;
		} else
			column++;

		i++;
		state = nstate;
	}

	result.tokens = wrealloc(result.tokens,
	                          sizeof(Token) * (++result.tokens_count));
	result.tokens[result.tokens_count - 1].type = EOI;
	result.tokens[result.tokens_count - 1].value = "";
	result.tokens[result.tokens_count - 1].filename = filename;
	result.tokens[result.tokens_count - 1].line = line;
	result.tokens[result.tokens_count - 1].column = column;

	result.ok = 1;

	return result;
}
